  function funcLogin() {
    log("funcLogin");
    const tag = lsg("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 10) return;
    lss("TZ_LOGOUT", new Date().getTime());

    
logParam.sub_type = "login";
message: "start login";
TZLOG(logParam, (data) => {}); 
ctl00_contents_userID.value = '${login_id}';
