funcSearch:
  function funcSearch() {
    log("funcSearch");
    const els = doc.gcn("cancelBtn");
    const dictCourse = {
      11: "파크",
      22: "밸리",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      const param = el.attr("onclick").inparen();
      const [elDate, elTime, elCourse] = param;

      console.log("reserve search", dictCourse[elCourse], elDate, elTime);
      result.push({ date: elDate, time: elTime, course: dictCourse[elCourse] });
    });
    const param = {
      command: "SUCCESS_OF_RESERVE_SEARCH",
      golf_club_id: "20e579ca-cdb8-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    getDetail(param, (exParam) => {
        if(ac) ac.message(JSON.stringify(exParam));
    });
